func numberOfPowerfulInt(start int64, finish int64, limit int, s string) int64 {
    var count int64 = 0
    suffix, _ := strconv.ParseInt(s, 10, 64)
    if suffix > finish {
        return 0
    }
    suffixLength := int64(len(s))
    startPrefix := start / int64(math.Pow10(int(suffixLength)))
    endPrefix := finish / int64(math.Pow10(int(suffixLength)))
    for prefix := startPrefix; prefix <= endPrefix; prefix++ {
        if prefix == 0 || checkPrefix(prefix, int64(limit)) {
            powerfulInt := prefix*int64(math.Pow10(int(suffixLength))) + suffix
            if powerfulInt >= start && powerfulInt <= finish {
                count++
            }
        }
    }
    if startPrefix == 0 {
        count-- // Exclude the suffix itself if counted twice
    }
    return count
}

func checkPrefix(prefix int64, limit int64) bool {
    for prefix > 0 {
        if prefix%10 > limit {
            return false
        }
        prefix /= 10
    }
    return true
}
